import React from "react";
import Accordian1 from "../main/components/Accordian1";

const QuestionsAny = () => {
  return (
    <div className="mt-20 flex flex-col justify-center items-center">
      <h1 className="text-[ADB3BE] contrast-50 font-semibold">
        HAVE ANY QUESTIONS?
      </h1>
      <h1 className="text-[#050F4E] text-4xl mt-6">
        Frequently Asked Questions
      </h1>
      <input
        type="text"
        placeholder="Search service you need...."
        className="w-[437px] h-[55px] bg-[#F6F7F9] mt-4 rounded-md"
      />
      <Accordian1 />
      <Accordian1 />
      <Accordian1 />
      <Accordian1 />
      <Accordian1 />
    </div>
  );
};

export default QuestionsAny;
